import React,{PureComponent} from 'react'; 
import {QrcodeWrapper} from '../style';
import {Link} from 'react-router-dom';
class Qrcode extends PureComponent{
    render(){
        return (
            <QrcodeWrapper>
                <Link to="https://www.jianshu.com/apps">
                    <img ></img>

                </Link>
            </QrcodeWrapper>
        )

    }
}
export default Qrcode;
